import React from 'react';
import ReactDOM from 'react-dom';
import CommentDetail from './CommentDetail'
import faker from "faker";

const App = () => {
  return (
    <div className="ui semantic comments">
      <CommentDetail author="Sam" timeAgo="Today at 6:00PM" comment="Amazing Book!" image={faker.image.image()} />
      <CommentDetail author="Alex" timeAgo="Today at 10:00AM" comment="One of the best book" image={faker.image.image()} />
      <CommentDetail author="Jane" timeAgo="Yesterday at 10:00PM" comment="Fantastic!" image={faker.image.image()} />
    </div>
  );
};

ReactDOM.render(<App />, document.querySelector("#root"))
